import React from 'react';

import NewsSlider from '../../../widgets/NewsSlider/slider'
import NewsList from '../../../widgets/NewsList/newsList';
const NewsMain = () => (
    <div>
      <NewsSlider 
        type="featured"
        settings={{dots:false}}
        start={0}
        amount={3}
      />
      <NewsList 
        type="card"
        loadMore={true}
        start
      />
    </div>
  );

export default NewsMain;
